import { useEffect, useState } from 'react';
import styles from "./projects.module.css"

export default function Projects() {
  console.log("Project component rendering");

  const [name, setName] = useState(null);
  const [date, setDate] = useState(null);
  const [description, setDesc] = useState(null);
  const [link, setLink] = useState(null);
  const [stack, setStack] = useState(null);
  const [image, setImage] = useState(null);

  // Fetch projec on component mount
  useEffect(() => {
      const fetchProject = async () => {
          try {
              // const url = 'https://nodejsportfolio-4xnq.onrender.com/api/projects';
              // const response = await fetch(url);
              // if (!response.ok) {
              //   throw new Error(`HTTP error! status: ${response.status}`);
              // }
            
              // const data = await response.json();
              // console.log('Fetched data:', data);

              const data = [{
                  "image": {
                      "data": "",
                      "contentType": "image/jpeg"
                  },
                  "_id": "674a9c53a7feece42f3597fa",
                  "name": "Test",
                  "date": "2024-11-14",
                  "description": "Coffee Time a coffee recipe app that helps coffee lovers to brew their perfect cup of joe",
                  "link": "https://github.com/codesuzyworld/NodeJsPortfolio",
                  "stack": ["Javascript", "Node.js"],
                  "__v": 0
              }];
              
              // Since data is an array, we need to access the first item
              if (data && data[0]) {
                  const project = data[0];
                  setName(project.name);
                  setDate(project.date);
                  setDesc(project.description);
                  setLink(project.link);
                  setStack(project.stack);
                  setImage(project.image);
              }
          } catch (error) {
              console.error("Error fetching project:", error);
          }
      };
      
      fetchProject();
  }, []);

  let skillColor = [
    "#8E6044",
    "#774740",
    "#604F62",
    "#515B48",
    "#4F5662",
  ]

  // Rest of your component code remains the same
  return (
    <div className={styles.projectSection}>
      <h2>Projects</h2>
      <div className={styles.projectCard}>
        <div className={styles.projectImage}>
          {image?.data && 
              <img src={`data:${image.contentType};base64,${image.data}`} alt={name || "Project"} />
          }
        </div>
        <div className={styles.projectInfo}>
          <div className={styles.projectName}>{name || "Loading Project Name..."}</div>
          <div>{stack && stack.length > 0 && (
            <div className={styles.projectStack}>
              <div className={styles.stackList}>
                {stack.map((tech, index) => (
                  <span 
                    key={index}
                    className={styles.stackTag}
                    style={{ 
                      backgroundColor: skillColor[Math.floor(Math.random() * skillColor.length)], 
                      color: '#F3E4CB' 
                    }}>
                    {tech}
                  </span>
                ))}
              </div>
            </div>
          )}</div>
          <div className={styles.projectDescription}>{description || "Loading description..."}</div>
          <a 
            href={link}
            className={styles.projectButton}
          >
            View Project
          </a>
        </div>
      </div>
    </div>
);
}